import React, { useEffect, useState } from 'react';
import './App.css';
import axios from 'axios';
import { ScatterChart, Scatter, XAxis, YAxis, Tooltip, CartesianGrid } from 'recharts';

const App = () => {
    const [xMin, setXMin] = useState('');
    const [xMax, setXMax] = useState('');
    const [yMin, setYMin] = useState('');
    const [yMax, setYMax] = useState('');
    const [numPoints, setNumPoints] = useState('');
    const [timeMin, setTimeMin] = useState('');
    const [timeMax, setTimeMax] = useState('');
    const [data, setData] = useState([]);
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState('');
    const [entities, setEntities] = useState([]);

    useEffect(() => {
        const intervalId = setInterval(() => {
            setData(prevData =>
                prevData
                    .map(item => ({ ...item, seconds: item.seconds - 1 }))
                    .filter(item => item.seconds > 0)
                    .sort((a, b) => b.seconds - a.seconds));
        }, 1000);

        return () => clearInterval(intervalId);
    }, []);

    const handleSubmit = (e) => {
        e.preventDefault();

        const xMinNum = parseInt(xMin);
        const xMaxNum = parseInt(xMax);
        const yMinNum = parseInt(yMin);
        const yMaxNum = parseInt(yMax);
        const numPointsNum = parseInt(numPoints);
        const timeMinNum = parseInt(timeMin);
        const timeMaxNum = parseInt(timeMax);

        if (!xMin || !xMax || !yMin || !yMax || !numPoints || !timeMin || !timeMax) {
            setError('All fields are required. Please fill in all values.');
            return;
        }

        if (isNaN(xMinNum) || isNaN(xMaxNum) || isNaN(yMinNum) || isNaN(yMaxNum) ||
            isNaN(numPointsNum) || isNaN(timeMinNum) || isNaN(timeMaxNum)) {
            setError('All inputs must be valid numbers.');
            return;
        }

        if (xMinNum < 0 || xMinNum > 90 ||
            xMaxNum < xMinNum + 10 ||
            xMaxNum > 100) {
            setError('Invalid X values. X Min must be between 0 and 90, and X Max must be at least X Min + 10 (up to 100).');
            return;
        }

        if (yMinNum < 0 || yMinNum > 90 ||
            yMaxNum < yMinNum + 10 ||
            yMaxNum > 100) {
            setError('Invalid Y values. Y Min must be between 0 and 90, and Y Max must be at least Y Min + 10 (up to 100).');
            return;
        }

        if (numPointsNum < 2 || numPointsNum > 10) {
            setError('Number of points must be between 2 and 10.');
            return;
        }

        if (timeMinNum < 5 || timeMinNum > 60 ||
            timeMaxNum < timeMinNum ||
            timeMaxNum > 60) {
            setError('Time values must be between 5 and 60 seconds, and Max must be greater than Min.');
            return;
        }

        setError('');
        fetchData();
    };

    const fetchData = async () => {
        setLoading(true);
        const randomData = Array.from({ length: numPoints }, (_, index) => ({
            x: Math.random() * (xMax - xMin) + xMin,
            y: Math.random() * (yMax - yMin) + yMin,
            seconds: Math.floor(Math.random() * (timeMax - timeMin) + timeMin)
        }));

        try {
            // Simulating an API call
            const response = await axios.post('/api/data', { data: randomData });
            setData(randomData);
            setEntities(response.data);
        } catch (error) {
            setError('Error fetching data');
        } finally {
            setLoading(false);
        }
    };

    return (
        <div className="app-container">
            <h1>RGraph</h1>

            <div className="horizontal-container">
                <div className={`input-container ${loading ? 'locked' : ''}`}>
                    {loading && (
                        <div className="locked-message">
                            הטבלה נעולה, אנא חכה לסיום הריצה
                        </div>
                    )}

                    <h2>Input Values</h2>
                    <form onSubmit={handleSubmit}>
                        <div className="input-group">
                            <label>X Min:</label>
                            <input type="number" value={xMin} onChange={(e) => setXMin(e.target.value)} />
                        </div>
                        <div className="input-group">
                            <label>X Max:</label>
                            <input type="number" value={xMax} onChange={(e) => setXMax(e.target.value)} />
                        </div>
                        <div className="input-group">
                            <label>Y Min:</label>
                            <input type="number" value={yMin} onChange={(e) => setYMin(e.target.value)} />
                        </div>
                        <div className="input-group">
                            <label>Y Max:</label>
                            <input type="number" value={yMax} onChange={(e) => setYMax(e.target.value)} />
                        </div>
                        <div className="input-group">
                            <label>Number of Points:</label>
                            <input type="number" value={numPoints} onChange={(e) => setNumPoints(e.target.value)} />
                        </div>
                        <div className="input-group">
                            <label>Time Min (seconds):</label>
                            <input type="number" value={timeMin} onChange={(e) => setTimeMin(e.target.value)} />
                        </div>
                        <div className="input-group">
                            <label>Time Max (seconds):</label>
                            <input type="number" value={timeMax} onChange={(e) => setTimeMax(e.target.value)} />
                        </div>
                        {error && <p style={{ color: 'red' }}>{error}</p>}
                        <button type="submit">Generate Data</button>
                    </form>
                </div>

                <div className="scroll-container">
                    <h2>MongoDB Entities</h2>
                    {entities.map((entity, index) => (
                        <div key={index} className="entity-item">
                            {entity.name}
                        </div>
                    ))}
                </div>

                <div className="data-table-container">
                    <h2>Live Data Table</h2>
                    <table className="data-table">
                        <thead>
                            <tr>
                                <th>X</th>
                                <th>Y</th>
                                <th>Seconds</th>
                            </tr>
                        </thead>
                        <tbody>
                            {data.map((item, index) => (
                                <tr key={index}>
                                    <td>{item.x.toFixed(2)}</td>
                                    <td>{item.y.toFixed(2)}</td>
                                    <td>{item.seconds}</td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>

                <div className="chart-container">
                    <h2>LIVE Graph</h2>
                    <ScatterChart width={600} height={600}>
                        <CartesianGrid />
                        <XAxis dataKey="x" />
                        <YAxis dataKey="y" />
                        <Tooltip />
                        <Scatter name="Data" data={data} fill="#8884d8" />
                    </ScatterChart>
                </div>
            </div>
        </div>
    );
};

export default App;
